MongoDb 4.2: query with index scan on a sharded collection is very slow<p>I am experiencing very slow performance when running the following query against a sharded collection (MongoDb 4.2.1):</p>

<pre><code>db.dc.find({
'hierarchy.company': 'PICCOLO_SRL',
"hierarchy.brand": 'PICCOLO_PICCOLO',
'dcheader.doc_date': {
    $gte: 1569016800,
    $lte: 1571695140
},
'dcheader.cardnr': '0461000402452'})
</code></pre>

<p>The query uses the following index, that is not the shard index:</p>

<pre><code>"key" : {
            "hierarchy.company" : 1,
            "hierarchy.brand" : 1,
            "dcheader.doc_date" : 1,
            "dcheader.cardnr" : 1
        }
</code></pre>

<p>The collection contains 4.5M docs and its size is 20.2GB. The shard index is hashed type and the shard is balanced.</p>

<p>The query execution plan is the following:</p>

