<p>As you can see, it seems like the SHARD_MERGE stage takes about 168000 millis: can anyone explain why? </p>

<p>Please note that I have never had such bad performances using a previuos MongoDb version (3.6).</p>

<p>Also I have not found detailed information about the SHARD_MERGE stage: which process does perform this task (mongod or mongos)? What happens during this stage?</p>

<p>My architecture is composed of three Centos 7 machines, each one hosts three mongod processes (shard1 replica set, shard2 replica set and config replica set) and a mongos process.</p>

