<p><strong>What I expect and want my code to do:</strong></p>

<ol>
<li>write the first document</li>
<li>sleep for 20 milliseconds</li>
<li>write the second document</li>
</ol>

<p><strong>What it seems to be doing now:</strong> </p>

<ol>
<li>write the first document</li>
<li>immediately write the second document</li>
<li>immediately write the third document</li>
</ol>

<p><strong>Here's an example of the code:</strong></p>

<pre><code>const Sleep = ms =&gt; new Promise(res =&gt; setTimeout(res, ms));

const MyFunction = array =&gt; {
  return Promise.all(array.map(row =&gt; {
    const item = new Item({
      "property1": row.property1,
      "property2": row.property2
    });
    Sleep(20) // tried putting a sleep here but that didn't work
    return item.save();
  }));
};
</code></pre>

