Sum column, between dates fields in Mongoose<p>I am trying to learn mongoose, I come from a SQL background and I am having difficulties figuring out how this works. </p>

<p>So I am essentially trying to run this SQL code in Mongoose</p>

<pre><code>$sql = "SELECT SUM(comdataPurchase)
              FROM fuel566243
              WHERE fuelDate BETWEEN '$startDate' AND '$endDate';";
</code></pre>

<p>But I cannot get it to work properly for me in mongoose. Here is what I have so far.</p>

<pre><code>FuelReceipt.aggregate([{$match:{date:{$gte: fuelStart, $lt: fuelEnd}}},
                {$group:{truckNumber: truckNumber, dieselGallons:{'$sum': '$count'}}}]).exec(function(err, data){
                    if(err){
                        console.log('Error Fetching Model');
                        console.log(err);
                    }
                    console.log(data);
                });
</code></pre>

<p>Thank you in advance for your help &lt;3</p>

<p>edit:-------------</p>

<p>This works:</p>

<pre><code>FuelReceipt.aggregate([
                {$group:{_id: '$truckNumber', 
                         dieselGallons:{$sum: '$dieselGallons'}}}]).exec(function(err, data){
                    if(err){
                        console.log('Error Fetching Model');
                        console.log(err);
                    }
                    console.log(JSON.stringify(data, null));
                });
</code></pre>

<p>This gives empty array:</p>

<pre><code>FuelReceipt.aggregate([
                {$match:{date:{$gte: fuelStart, $lte: fuelEnd}}},
                {$group:{_id: '$truckNumber', 
                         dieselGallons:{$sum: '$dieselGallons'}}}]).exec(function(err, data){
                    if(err){
                        console.log('Error Fetching Model');
                        console.log(err);
                    }
                    console.log(JSON.stringify(data, null));
                });
</code></pre>

<p>edit 2:----------------</p>

<p>I figured it out, had to change the data type for the start and end dates.</p>

<pre><code>FuelReceipt.aggregate([
                {$match:{date:{$gte: new Date(fuelStart), $lte: new Date(fuelEnd)}}},
                {$group:{_id: '$truckNumber', 
                         fuelCost:{$sum: '$fuelCost'}}}]).exec(function(err, data){
                    if(err){
                        console.log('Error Fetching Model');
                        console.log(err);
                    }
                    res.send(data);
                    console.log(JSON.stringify(data, null));
                });
</code></pre>

